import React from 'react'
import './Card.css'

const onImageClick = (url) => {
    console.log(url)
return(<div><img src={url} alt="Avatar" style={{ width: "100%" }}></img></div>)
}

const Card = (props) => {
    return (
        <div className="card">
            <div className="image-design">
            <img src={props.url} alt="Avatar" style={{ width: "100%" }} onClick = {onImageClick(props.url)}></img>
            </div>
            <div className="container">
                <h4><b>John Doe</b></h4>
                <p>Architect & Engineer</p>
            </div>
        </div>
    )
}

export default Card;
